import React, { Component } from 'react';
import {Grid, Cell} from 'react-mdl';


class LandingPage extends Component {
    render() {
        return(
            <div style={{width: '100%', margin: 'auto'}}>
               <Grid className="landing-grid">
                   <Cell col={12}></Cell>
                     <img
                      src = "https://www.google.com/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&ved=2ahUKEwiN-p_FzKfjAhUCbs0KHQXSCcwQjRx6BAgBEAU&url=https%3A%2F%2Fdentalogica-practice.co.uk%2Fhome%2Favatar-male%2F&psig=AOvVaw0ZOeusEvT3T4aCvOusbXm-&ust=1562753417508620"
                      alt="avatar"
                      className="avatar-image"
                       />


                       <div className='banner-text'>
                       <h1>Jr Web Developer</h1>
                       <hr/>
                        
                        <p> HTML/CSS | Javascript | React | React Native | Robotics |</p>
                           

                           <div className="social-links">
                          {/*Instagram*/}
                          <a href="http://google.com" rel="noopener noreferrer" target="_blank"> 
                          <i className="fa fa-instagram square" aria-hidden="true"/>
                          </a>  
                          {/*Steam*/}
                         <a href="http://google.com" rel="noopener noreferrer" target="_blank"> 
                          <i className="fa fa-steam square" aria-hidden="true"/>
                          </a> 
                          {/*Spotify*/}
                          <a href="http:google.com" rel="noopener noreferrer" target="_blank">
                          <i className="fa fa-spotify square" aria-hidden='true'/> 
                          </a> 
                        </div>
                       
                       </div>
                </Grid>
            </div>
            
        
 
          
        )   
    }     
}

export default LandingPage;
